}

// Function to update water height
function updateWaterHeight(idRect, waterHeight) {
    commands.push({
        "command": "set_attribute",
        "selector": "#" + idRect,
        "attributeName": "height",
        "attributeValue": waterHeight
    });
    //node.warn("updateWaterHeight: " + idRect + " -> " + waterHeight); // Debugging statement
}

// Function to set pipe style
function setStyle(selector, fill) {
    commands.push({
        "command": "set_style",
        "selector": selector,
        "attributeName": "fill",
        "attributeValue": fill
    });
}

// Function to handle alarm
function handleAlarm(levelStatus, boxNumber) {
    var waterHeight;
    if (levelStatus === 0) {
        waterHeight = 27;
    } else if (levelStatus === 1) {
        waterHeight = 13;
    }
    updateWaterHeight('watertank', waterHeight);
    //node.warn("handleAlarm: lv" + boxNumber + " = " + levelStatus); // Debugging statement
}

// Function to set sprayer style
function setSprayerStyle(sprayer, fill) {
    for (var k = 1; k <= 10; k++) {
        var sprayerSelector = "#waterSprayer" + sprayer + "-" + k;
        setStyle(sprayerSelector, fill);
    }
}

// Function to handle pipes and sprayers
function handlePipesAndSprayers(pompaStatus) {
    if (pompaStatus === "on") {
        setStyle("#pipe1, #pipe2", warnaMenyala);
        for (var j = 1; j <= 7; j++) {
            setSprayerStyle(j, warnaMenyala);
        }
    } else if (pompaStatus === "off") {
        setStyle("#pipe1, #pipe2", warnaMatiPipa);
        for (var i = 1; i <= 7; i++) {
            setSprayerStyle(i, warnaMati);
        }
    }
}

// Function to update rect height
function updateRectHeight(rectId, newHeight) {
    commands.push({
        "command": "set_attribute",
        "selector": "#" + rectId,
        "attributeName": "height",
        "attributeValue": 0.32 * newHeight
    });
}

// Function to update text content
function updateTextContent(textId, newText) {
    commands.push({
        "command": "update_text",
        "selector": "#" + textId,
        "textContent": newText
    });
}

// Function to rotate humidity
function rotateHumidity(selector, value, cx, cy) {
    var rotationAngle = (value / 100) * 360;
    commands.push({
        "command": "set_attribute",
        "selector": selector,
        "attributeName": "transform",
        "attributeValue": "rotate(" + rotationAngle + ", " + cx + ", " + cy + ")"
    });
}

// Fungsi untuk mengubah X axis
function updateXaxis(Id, newX) {
    commands.push({
        "command": "set_attribute",
        "selector": "#" + Id,
        "attributeName": "x",
        "attributeValue": newX
    });
}

// Function to update box data
function updateBoxData(boxNumber, tempValues, humValues, ecValue, phValue) {
    updateRectHeight('temp1', tempValues[0]);
    updateRectHeight('temp2', tempValues[1]);
    updateRectHeight('temp3', tempValues[2]);
    updateTextContent('box', "BOX " + boxNumber);
    updateTextContent('temptext1', tempValues[0] + 'C');
    updateTextContent('temptext2', tempValues[1] + 'C');
    updateTextContent('temptext3', tempValues[2] + 'C');
    rotateHumidity('#humidity1', humValues[0], 31.743778, 42.959644);
    rotateHumidity('#humidity2', humValues[1], 31.80023, 72.921234);
    updateTextContent('humiditytext1', humValues[0] + '%');
    updateTextContent('humiditytext2', humValues[1] + '%');
    updateTextContent('ectext', "EC " + ecValue + " uS/cm");
    updateTextContent('phText', "pH " + phValue);
    updateXaxis('phmeter', (phValue/14)*15+139);
    updateXaxis('tdsmeter', (ecValue/ 1400) * 15 + 139);
