        return null; // Hentikan alur jika data tidak lengkap
    }

    let sensors = data.sensors;
    let actuators = data.actuators;

    // 1. Set Sensor CWT (Suhu & Kelembapan)
    // Asumsi 'temp1' & 'hum1' berasal dari cwt[0]
    if (sensors.cwt && sensors.cwt[0]) {
        global.set("temp1", sensors.cwt[0].temperature);
        global.set("hum1", sensors.cwt[0].humidity);
    }
    // Asumsi 'temp2' & 'hum2' berasal dari cwt[1]
    if (sensors.cwt && sensors.cwt[1]) {
        global.set("temp2", sensors.cwt[1].temperature);
        global.set("hum2", sensors.cwt[1].humidity);
    }

    // 2. Set Sensor NPK (dan Kualitas Air)
    if (sensors.npk) {
        global.set("nitrogen", sensors.npk.nitrogen);
        global.set("phosphorus", sensors.npk.phosphorus);
        global.set("potassium", sensors.npk.potassium);

        // Sesuai skema database Anda sebelumnya:
        global.set("temp3", sensors.npk.temperature); // Suhu air
        global.set("ph1", sensors.npk.ph);
        global.set("ec1", sensors.npk.ec);
    }

    // 3. Set Sensor Lasers
    // Ini akan menyimpan sebagai 'laser1_status', 'laser2_status', dst.
    if (sensors.lasers && Array.isArray(sensors.lasers)) {
        sensors.lasers.forEach(laser => {
            if (laser.id && laser.status !== undefined) {
                // Membuat key dinamis, misal: "laser1_status"
                global.set(laser.id + "_status", laser.status);
            }
        });
    }

    // 4. Set Sensor Water Level
    // Sesuai skema database Anda sebelumnya: 'lv'
    if (sensors.water_level && sensors.water_level.status !== undefined) {
        global.set("lv1", sensors.water_level.status);
    }

    // 5. Set Actuators
    if (actuators.pump && actuators.pump.status !== undefined) {
        // Ambil status numerik (misal: 1 atau 0)
        let numericStatus = actuators.pump.status;

        // Konversi 1 -> "on", selain itu -> "off"
        let stringStatus = (numericStatus === 1) ? "on" : "off";

        // Set variabel global dengan string "on" atau "off"
        global.set("pump1", stringStatus);
    }


    if (actuators.solenoid_valve && actuators.solenoid_valve.status !== undefined) {
        global.set("solenoid_valve", actuators.solenoid_valve.status);
    }

    // Secara opsional, teruskan pesan asli jika diperlukan
    return msg;

} catch (e) {
    // Tangkap error jika struktur JSON salah
    node.error("Gagal memproses JSON: " + e.message, msg);
    return null; // Hentikan alur
}

// --- Konfigurasi ---
const MAX_ROWS_LIMIT = 75; // Batas aman maksimal data yang dikembalikan

// 1. Ambil Variabel dari Global Context
