const timeRange = global.get("dateTime") || "1d";
const box = global.get("box") || "box1";

// 2. Tentukan Format Grup Waktu untuk SQL
let groupByFormat = '';
// [BARU] Menambahkan opsi untuk 'w' (week) dan 'mo' (month) dari dropdown Anda
switch (interval) {
    case 's': groupByFormat = '%Y-%m-%d %H:%i:%s'; break;
    case 'h': groupByFormat = '%Y-%m-%d %H:00:00'; break;
    case 'd': groupByFormat = '%Y-%m-%d'; break;
    case 'w': groupByFormat = '%Y-%u'; break; // Grup per minggu
    case 'm':
    default: groupByFormat = '%Y-%m-%d %H:%i:00'; break;
}

// 3. Siapkan Parameter untuk klausa WHERE
const boxNumber = parseInt(box.replace('box', ''));

// [BARU] Logika yang lebih baik untuk menghitung tanggal mulai berdasarkan '1d', '1w', '1m', '1y'
let startDate = new Date();
const rangeNum = parseInt(timeRange); // Mengambil angka (misal: 1)
const rangeUnit = timeRange.slice(-1); // Mengambil unit (d, w, m, y)

switch(rangeUnit) {
    case 'd': startDate.setDate(startDate.getDate() - rangeNum); break;
    case 'w': startDate.setDate(startDate.getDate() - (rangeNum * 7)); break;
    case 'm': startDate.setMonth(startDate.getMonth() - rangeNum); break;
    case 'y': startDate.setFullYear(startDate.getFullYear() - rangeNum); break;
    default: startDate.setDate(startDate.getDate() - 1); // Default ke 1 hari
}
const formattedStartDate = startDate.toISOString().slice(0, 19).replace('T', ' ');

// 4. [DIPERBARUI] Buat Query SQL dengan Subquery untuk Urutan yang Benar
const query = `
    SELECT * FROM (
        -- Query Bagian Dalam: Ambil 75 grup data TERBARU
        SELECT 
            MIN(time) AS time,
            ROUND(AVG(temp1), 2) AS temp1,
            ROUND(AVG(temp2), 2) AS temp2,
            ROUND(AVG(temp3), 2) AS temp3,
            ROUND(AVG(hum1), 2) AS hum1,
            ROUND(AVG(hum2), 2) AS hum2,
            ROUND(AVG(ec), 2) AS ec,
            ROUND(AVG(ph), 2) AS ph
        FROM 
            box_aeroponik
        WHERE 
            box = ? AND time >= ?
        GROUP BY 
            DATE_FORMAT(time, '${groupByFormat}')
        ORDER BY 
            time DESC
        LIMIT 
            ${MAX_ROWS_LIMIT}
    ) AS recent_data
    -- Query Bagian Luar: Urutkan kembali data dari LAMA ke BARU
    ORDER BY 
        time ASC;
`;

// 5. Set msg.topic dan msg.payload untuk node mysql
msg.topic = query;
msg.payload = [boxNumber, formattedStartDate];

// node.warn(`Generated Query for interval '${interval}' and time range '${timeRange}'`);

return msg;

